%[text] %[text:anchor:T_48676C19] # **Value At Risk Chart Examples**
%[text] **Overview**
%[text] The `ValueAtRiskChart` displays the distribution of a given return series using a histogram. The chart also displays a non-parametric kernel-smoothed probability density fit (computed using `fitdist`) and two vertical lines indicating the empirical value at risk and conditional value at risk.
%[text] - The $x$% value at risk is the $(100-x)$th percentile of the return series data. For example, the $95\\%$ value at risk can be computed by taking the $5$th percentile of the return series values `r` . In `MATLAB` code, `VaR = prctile( r, 5 )`.
%[text] - The $x$% conditional value at risk is the mean of the returns which are less than the $x%$ value at risk. For example, the $95\\%$ conditional value at risk can be computed as:  `CVaR = mean( r( r < VaR ) )`, where `VaR` is the $95\\%$ value at risk. \
%[text] ![ValueAtRiskChart.png](text:image:8223)
%[text] The chart data comprises a numeric vector (`Data`). The value at risk threshold is set using the `VaRLevel` property of the chart (the default value is 0.95, corresponding to a $95\\%$ threshold). 
%[text] **Documentation**
%[text] - [`fitdist`](<matlab: web(fullfile(matlabroot, "help", "stats", "fitdist.html"), "-helpbrowser")>): fit a probability distribution object to a data set
%[text] - [`quantile`](<matlab: doc("quantile")>): quantiles of data set \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_CCCD6840] ## Create sample return series data from a t-distribution for the chart.
rng( "default" )
d = 0.02 * trnd(10, 2000, 1 );
%%
%[text] %[text:anchor:H_911C7504] ## Create a figure for the chart.
f = exampleFigure( "Name", "ValueAtRiskChart Example" );
%%
%[text] %[text:anchor:H_7F2991B4] ## Create and label the chart.
VRC = ValueAtRiskChart( "Parent", f, "Data", d ); %[output:2c5895d2]
%%
%[text] %[text:anchor:H_A6594FC0] ## Change the bar color and transparency.
VRC.FaceColor = [0, 0.5, 1]; %[output:10b967fe]
VRC.FaceAlpha = 0.5; %[output:10b967fe]
%%
%[text] %[text:anchor:H_544CB5FC] ## Adjust the value at risk level.
VRC.VaRLevel = 0.99; %[output:9630f9de]
%%
%[text] %[text:anchor:H_F67C720D] ## Update the chart data and value at risk level.
newData = 0.20 * randn( 1000, 1 );
set( VRC, "Data", newData, "VaRLevel", 0.95 ) %[output:25e1f044]
%%
